Aqara Home is an app for smart home automation and control. With Aqara Home, you can:

1. control Aqara accessories anywhere and anytime where there is Internet access;

2. create homes and rooms and assign accessories to the rooms;

3. control your Aqara accessories and check the status of connected appliances. For example:
    *adjust the brightness of lights and check the power consumption of home appliances;
    *monitor the temperature, humidity and air pressure;
    *detect water leak, and human movement;

4. create Automations to automate your home. For example:
     *set a timer to turn on or off an appliance connected to a smart plug;
     *use a Door and Window Sensor to trigger lights: turn on lights automatically when the door opens;

5. create Scenes to control multiple accessories. For example, add a Scene to turn on multiple lights and fans; 

6. ask Siri to control HomeKit supported Aqara accessories and user defined Scenes; Aqara Home app supports following Aqara accessories: Aqara Hub, Smart Plug, Wireless Remote Switch, LED Light Bulb, Door and Window Sensor, Motion Sensor, Temperature and Humidity Sensor, Vibration Sensor, and Water Leak Sensor.  Please see www.aqara.com for more details.

В приложении вы найдете утренние и вечерние молитвы, Правило ко Святому Причащению, а также основные Православные молитвы, необходимые верующему. Помимо основных Православных молитв, в нем присутствует огромное количество молитв святым, на разные случаи жизни, множество икон и просветительских видео. Также данное приложение поможет Вам найти ближайшие Православные храмы при помощи карты. Данное приложение станет помощником верующему в любой месте и в любой момент.

Основные плюсы данного молитвослова:
• Огромное количество молитв, как основных, так и посвященных святым или случаям жизни;

• Молитвы содержат пояснения, перевод с церковнославянского, а также информацию о житие святых;

• Доступны три режима просмотра молитвы: детальный режим, позволяющий изучать молитву постранично, включающий пояснения и переводы;  режим быстрой навигации по молитве, позволяющий быстро переключиться на нужный фрагмент; полнотекстовый режим, позволяющий читать молитву не отвлекаясь ни на что;

• Приложение содержит огромное количество изображений старых Православных икон, с описанием. Здесь вы найдете и изучите Православные иконы со всего мира! 

• Содержит аудио-молитвы!!

• Возможность добавления молитв и икон в избранное для быстрого их нахождения в дальнейшем;

• Молитвослов содержит раздел с просветительскими видео! Изучайте и укрепляйтесь в Православной вере вместе с богословами и преподавателями духовных семинарий;

• Раздел "календарь" каждый день дает возможность изучать Святое Писание данного дня. Это позволит прихожанам легко и удобно готовиться к службам

