• Есть полный текст Евангелие в синодальном переводе

• В разделе "Храмы на карте" Вы сможете найти ближайшие Православные храмы;

• Молитвослов полностью бесплатный и создан в просветительских целях.  С каждым новым обновлением количество молитв и видео будет увеличиваться! 

